<template>
  <div>
    <style>
      .container {
        position: absolute;
        width: 450px;
        height: 450px;
        top: 60%;
        left: 50%;
        transform: translate(-50%, -50%);
      }

      #canvas1 {
      }

      .controls {
        display: flex;
      }

      .controls > input {
        width: 60%;
      }

      .controls > label {
        width: 35%;
        color: white;
        font-size: 15px;
      }

      /* Slider Styling */
      .slider {
        -webkit-appearance: none;
        width: 100%;
        height: 10px;
        border-radius: 5px;
        background: #d3d3d3;
        outline: none;
        opacity: 0.7;
        -webkit-transition: 0.2s;
        transition: opacity 0.2s;
      }

      .slider::-webkit-slider-thumb {
        -webkit-appearance: none;
        appearance: none;
        width: 10px;
        height: 10px;
        border-radius: 50%;
        background: #04aa6d;
        cursor: pointer;
      }

      .slider::-moz-range-thumb {
        width: 10px;
        height: 10px;
        border-radius: 50%;
        background: #04aa6d;
        cursor: pointer;
      }

      /* Mouse-over effects */
      .slider:hover {
        opacity: 1; /* Fully shown on mouse-over */
      }

      /* The slider handle (use -webkit- (Chrome, Opera, Safari, Edge) and -moz- (Firefox) to override default look) */
      .slider::-webkit-slider-thumb {
        -webkit-appearance: none; /* Override default look */
        appearance: none;
        width: 15px; /* Set a specific slider handle width */
        height: 15px; /* Slider handle height */
        background: #04aa6d; /* Green background */
        cursor: pointer; /* Cursor on hover */
      }

      .slider::-moz-range-thumb {
        width: 15px; /* Set a specific slider handle width */
        height: 15px; /* Slider handle height */
        background: #04aa6d; /* Green background */
        cursor: pointer; /* Cursor on hover */
      }
    </style>
    <div
      class="p-10 bg-gradient-to-b from-slate-900 to-slate-800 w-screen min-h-screen"
    >
      <PageHeader />
      <div class="grid grid-cols-8 m-5 p-5 gap-3 z-1">
        <h1 class="col-span-8 col-start-6 text-slate-200 text-4xl z-0">
          Image to Ascii
        </h1>
        <div class="col-span-4 col-start-3">
          <canvas id="canvas1" class="w-full z-2"></canvas>
        </div>
        <div class="col-span-4 col-start-3 pt-5 mt-5">
          <div class="controls z-1">
            <label id="resolutionLabel" for="resolution">Resolution 5 px</label>
            <input
              id="resolution"
              class="slider z-10"
              type="range"
              name="resolution"
              min="1"
              max="100"
              value="1"
            />
          </div>
        </div>
        <div class="col-span-3 col-end-6"></div>
      </div>
    </div>
  </div>
</template>

<script>
export default {
  name: 'ImageToAscii',
  data: () => ({}),
  mounted() {
    /** @type {HTMLCanvasElement} */
    const canvas = document.getElementById('canvas1')
    const ctx = canvas.getContext('2d')

    const image1 = new Image()
    image1.src =
      'data:image/png;base64,'

    const inputSlider = document.getElementById('resolution')
    const inputLabel = document.getElementById('resolutionLabel')
    inputSlider.addEventListener('input', handleSlider)

    class Cell {
      constructor(x, y, symbol, color) {
        this.x = x
        this.y = y
        this.symbol = symbol
        this.color = color
      }

      draw(ctx) {
        ctx.fillStyle = 'rgba(191,191,191,0.3)'
        ctx.fillText(this.symbol, this.x + 0.2, this.y + 0.2)
        ctx.fillStyle = this.color
        ctx.fillText(this.symbol, this.x, this.y)
      }
    }

    class AsciiEffect {
      #imageCellArray = []
      #pixels = []
      #ctx
      #width
      #height

      constructor(ctx, width, height) {
        this.#ctx = ctx
        this.#width = width
        this.#height = height

        this.#ctx.drawImage(image1, 0, 0, this.#width, this.#height)
        this.#pixels = this.#ctx.getImageData(0, 0, this.#width, this.#height)
        console.log(this.#pixels.data)
        // contains a uint8 clamped array, can only contain unassigned 8-bit integers
        // this array contains all pixels (every 4 elements is one pixel - rgba)
        // the opacity here can take a value of 0 - 255 (not like css 0 - 1)
      }

      #convertToSymbol(g) {
        if (g > 250) return '@'
        else if (g > 240) return '*'
        else if (g > 230) return '+'
        else if (g > 220) return '#'
        else if (g > 210) return '@'
        else if (g > 200) return '&'
        else if (g > 190) return '/'
        else if (g > 180) return '_'
        else if (g > 170) return ':'
        else if (g > 160) return '>'
        else if (g > 150) return '>'
        else if (g > 140) return '['
        else if (g > 130) return ']'
        else if (g > 120) return '{'
        else if (g > 110) return '}'
        else if (g > 100) return '!'
        else if (g > 95) return ','
        else if (g > 90) return '9'
        else if (g > 85) return '8'
        else if (g > 80) return '^'
        else if (g > 75) return '7'
        else if (g > 60) return '='
        else if (g > 40) return '|'
        else if (g > 30) return '4'
        else if (g > 25) return '3'
        else if (g > 20) return '?'
        else if (g > 15) return '2'
        else if (g > 10) return '1'
        else if (g > 5) return '0'
        else return ''
      }

      #scanImage(cellSize) {
        this.#imageCellArray = []
        // Cellsize determines the gridsize
        for (let y = 0; y < this.#pixels.height; y += cellSize) {
          for (let x = 0; x < this.#pixels.width; x += cellSize) {
            const posX = x * 4
            const posY = y * 4
            const pos = posY * this.#pixels.width + posX

            // We assume 128 as the threshold for transparency here (+ 3 refers to the last index of the array)
            if (this.#pixels.data[pos + 3] > 200) {
              const red = this.#pixels.data[pos]
              const green = this.#pixels.data[pos + 1]
              const blue = this.#pixels.data[pos + 2]
              const total = red + green + blue
              const averageColorValue = total / 3
              const color = 'rgb(' + red + ',' + green + ',' + blue + ')'
              const symbol = this.#convertToSymbol(averageColorValue)
              if (total > 20)
                this.#imageCellArray.push(new Cell(x, y, symbol, color))
            }
          }
        }
        console.log(this.#imageCellArray)
      }

      #drawAscii() {
        this.#ctx.clearRect(0, 0, this.#width, this.#height)
        for (let i = 0; i < this.#imageCellArray.length; i++) {
          this.#imageCellArray[i].draw(this.#ctx)
        }
      }

      draw(cellSize) {
        this.#scanImage(cellSize)
        this.#drawAscii()
      }
    }

    let effect

    function handleSlider() {
      if (inputSlider.value === 1) {
        inputLabel.innerHTML = 'Original Image'
        // ctx.drawImage(image1, 0, 0, canvas.width, canvas.height);
      } else {
        inputLabel.innerHTML = 'Resolution: ' + inputSlider.value + ' px'
        ctx.font = parseInt(inputSlider.value) * 1.2 + 'px Verdana'
        effect.draw(parseInt(inputSlider.value))
      }
    }

    image1.onload = function initialize() {
      canvas.width = image1.width
      canvas.height = image1.height
      // ctx.drawImage(image1, 0, 0);
      effect = new AsciiEffect(ctx, image1.width, image1.height)
      handleSlider()
    }
  },
  methods: {},
}
</script>
